tables.table_schema:
CREATE TABLE sensor_data (
    sensor_id INT PRIMARY KEY,
    building_id INT,
    light_intensity FLOAT,
    recorded_at TIMESTAMP
);

CREATE TABLE efficiency_plan (
    plan_id INT PRIMARY KEY,
    building_id INT,
    efficiency_rating FLOAT,
    last_updated DATE
);

CREATE TABLE LightIntensityData (
  sensor_id INT PRIMARY KEY,
  timestamp TIMESTAMP,
  intensity FLOAT
);

CREATE TABLE BuildingInformation (
  building_id INT PRIMARY KEY,
  building_name VARCHAR(255),
  address VARCHAR(255),
  floor_count INT
);

CREATE TABLE EfficiencyPlan (
  plan_id INT PRIMARY KEY,
  building_id INT,
  target_intensity FLOAT,
  target_savings FLOAT
);

CREATE TABLE light_intensity_data (
  sensor_id INT PRIMARY KEY,
  location VARCHAR(255),
  intensity DECIMAL,
  timestamp TIMESTAMP
);

CREATE TABLE buildings (
  building_id INT PRIMARY KEY,
  building_name VARCHAR(255),
  address VARCHAR(255),
  floors INT
);

CREATE TABLE sensors (
    sensor_id INT PRIMARY KEY,
    location VARCHAR(255),
    intensity FLOAT
);

CREATE TABLE buildings (
    building_id INT PRIMARY KEY,
    building_name VARCHAR(255),
    location VARCHAR(255)
);

CREATE TABLE analysis_results (
    result_id INT PRIMARY KEY,
    data_id INT,
    efficiency_score FLOAT,
    FOREIGN KEY (data_id) REFERENCES sensor_data(data_id)
);
